import React, {Component} from 'react';
import axios from 'axios';

class Konto extends Component {
    constructor(props){
        super(props);
        this.state = {
            history : null,
        };
    }
    componentDidMount() {
        axios.get(`http://localhost:8081/history/all`).then((response) => {
            this.setState({history: response.data})
        });


    }


    render() {
        return (
            <div className="data-in-page">
                <Container className="data-in-page">
                        <Table>
                            <thead>
                            <tr>
                                <th>Rodzaj</th>
                                <th>Rodzaj ID</th>
                                <th>Typ</th>
                                <th>Data</th>

                            </tr>
                            </thead>
                            <tbody>

                                this.state.history.map((element: any) => (
                                    <>
                                        <tr>
                                            <td>{element.rod}</td>
                                            <td>{element.idRod}</td>
                                            <td>{element.tdok}</td>
                                            <td>{Moment(element.dat).format("DD-MM-YYYY hh:mm")}</td>
                                        </tr>

                                    </>
                                ) )
                            }
                            </tbody>
                        </Table>
                </Container>
            </div>
        );
    }
}

export default Konto;
